import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

// import { Container, Row, Col } from 'react-bootstrap';
import { BrowserRouter, Link, Route, Switch } from 'react-router-dom';
import { Container, Row, Col } from 'react-bootstrap';

//Pages
import ProfilePage from './pages/ProfilePage/ProfilePage';
import ContentItemPage from './components/ContentItemPage/ContentItemPage';
// import ItemPage2 from './pages/ItemPage2/ItemPage2';

//Components
import {Navbar} from './components/Navbar/Navbar';
// import {ProfileCard} from './components/ProfileCard/ProfileCard';
// import {ProfileButtons} from './components/ProfileButtons/ProfileButtons';
// import {AboutMe} from './components/AboutMe/AboutMe';





function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Container className="container-1">
        <Row>
            <Col>
              <Navbar />
            </Col>
          </Row>
          <br></br>
          <BrowserRouter>
            <Switch>
              <Route component={ProfilePage} exact path="/profilepage" />
              <Route component={ContentItemPage} exact path="/contentitempage" />
              {/* <Route component={ItemPage2} exact path="/ItemPage2" /> */}
            </Switch>
          </BrowserRouter>
        </Container>

      </header>
    </div>
  );
}

export default App;
